  \"aiddata\",\n\t\"isopen\": true,\n\t\"url\": null,\n\t\"notes\": \"AidData is a
  research and innovation lab making information on development finance more accessible
  and actionable. Tracking more than $6 trillion dollars from 90+ donor agencies,
  AidData undertakes cutting-edge research on aid distribution and impact, geocodes
  and crowdsources aid information, and develops applications and custom data solutions
  for diverse stakeholders. The AidData team works with a wide range of partner organizations
  to collect, visualize, and analyze development finance for more effective development
  policy, practice, and research.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
